void loop() {
  bool reading1 = !digitalRead(BTN1); // Olvassuk be az 1. nyomÃ³gomb Ã¡llapotÃ¡t negÃ¡lva, ha a GND-ra van csatlakoztatva
  bool reading2 = !digitalRead(BTN2); // Olvassuk be a 2. nyomÃ³gomb Ã¡llapotÃ¡t negÃ¡lva, ha a GND-ra van csatlakoztatva
  bool reading3 = digitalRead(SWITCH); // Olvassuk be a kapcsolÃ³ Ã¡llapotÃ¡t
  potValue=analogRead(POT);

  // Ha az 1. gomb Ã¡llapota vÃ¡ltozott
  if (reading1 != lastButton1State) {
    // FrissÃ­tjÃ¼k a prellmentes idÅ‘tartam kezdeti idejÃ©t
    lastDebounceTime1 = millis();
  }

  // EllenÅ‘rizzÃ¼k, hogy a gomb Ã¡llapota stabil-e a prellmentes idÅ‘ utÃ¡n
  if ((millis() - lastDebounceTime1) > debounceDelay) {
    // Ha igen, akkor frissÃ­tjÃ¼k a gomb Ã¡llapotÃ¡t
    if (reading1 != button1State) {
      button1State = reading1;

      // Ha a gombot lenyomtad
      if (button1State == HIGH) {
        Serial.println("1. nyomÃ³gomb lenyomva");
        tone(BUZZER,potValue*2+500+reading3*1000);
        counter--;
        if (counter==1) counter=9;
      } 
      // Ha a gombot elengedted
      else {
        Serial.println("1. nyomÃ³gomb elengedve");
        noTone(BUZZER);
      }
    }
  }
  // Ha a 2. gomb Ã¡llapota vÃ¡ltozott
  if (reading2 != lastButton2State) {
    // FrissÃ­tjÃ¼k a prellmentes idÅ‘tartam kezdeti idejÃ©t
    lastDebounceTime2 = millis();
  }

  // EllenÅ‘rizzÃ¼k, hogy a gomb Ã¡llapota stabil-e a prellmentes idÅ‘ utÃ¡n
  if ((millis() - lastDebounceTime2) > debounceDelay) {
    // Ha igen, akkor frissÃ­tjÃ¼k a gomb Ã¡llapotÃ¡t
    if (reading2 != button2State) {
      button2State = reading2;

      // Ha a gombot lenyomtad
      if (button2State == HIGH) {
        Serial.println("2. nyomÃ³gomb lenyomva");
        tone(BUZZER,potValue*3+1000+reading3*1000);
        counter++;
        if (counter==10) counter=2;
      } 
      // Ha a gombot elengedted
      else {
        Serial.println("2. nyomÃ³gomb elengedve");
        noTone(BUZZER);
      }
    }
  }

  // Ha a kapcsolÃ³ Ã¡llapota vÃ¡ltozott
  if (reading3 != lastSwitchState) {
    // FrissÃ­tjÃ¼k a prellmentes idÅ‘tartam kezdeti idejÃ©t
    lastDebounceTime3 = millis();
  }

  // EllenÅ‘rizzÃ¼k, hogy a kapcsolÃ³ Ã¡llapota stabil-e a prellmentes idÅ‘ utÃ¡n
  if ((millis() - lastDebounceTime3) > debounceDelay) {
    // Ha igen, akkor frissÃ­tjÃ¼k a kapcsolÃ³ Ã¡llapotÃ¡t
    if (reading3 != switchState) {
      switchState = reading3;

      // Ha a kapcsolÃ³t balra Ã¡llÃ­tottad
      if (switchState == LOW) {
        Serial.println("A kapcsolÃ³ balra van Ã¡llÃ­tva.");
      } 
      // Ha a kapcsolÃ³t jobbra Ã¡llÃ­tottad
      else {
        Serial.println("A kapcsolÃ³ jobbra van Ã¡llÃ­tva.");
      }
    }
  }
  if (prevCounter!=counter){
    digitalWrite(counter,HIGH);
    digitalWrite(prevCounter,LOW);
    prevCounter=counter;
  }
  // A nyomÃ³gombok Ã©s kapcsolÃ³ aktuÃ¡lis Ã¡llapotÃ¡t eltÃ¡roljuk az elÅ‘zÅ‘ Ã¡llapotban
  lastButton1State = reading1;
  lastButton2State = reading2;
  lastSwitchState = reading3;
